import { TableViewRoot } from "./Table.styles";


import { UserInfo } from "../../types";

const convertTime = (msTime:number) => {
  let numerator = msTime;
  const minutes = Math.floor(numerator/60000);

  numerator -= (minutes * 60000);
  const seconds = Math.floor(numerator/1000);

  numerator -= (seconds * 1000);
  const milliseconds = Math.floor(numerator/10);

  return `${minutes}:${seconds}:${milliseconds}`

}

const Table = (props : {userData:UserInfo[]}) => {

  const {userData} = props;

  return (
    <TableViewRoot>
      <div className="table">
        <div className="row">
          <div className="headerCell">Rank</div>
          <div className="headerCell">Name</div>
          <div className="headerCell">Time</div>
        </div>
        {userData.map((user, idx) => {
          return(
            <div className="row">
              <div style={{textAlign:'right'}} className="cell">#{idx+1}</div>
              <div className="cell">{user.name}</div>
              <div style={{textAlign:'center'}} className="cell">{user.msTime}</div>
            </div>
          )
        })}

      </div>
    </TableViewRoot>
  );
};

export default Table;
